import axios from "axios"
const SERVER = 'http://127.0.0.1:8000'
const headers = {
  'Content-Type': 'application/json',
  'Authorization': 'JWT fefege..'
}

const world = () => axios.get(`${SERVER}/api/map/world-maps`)
const medPoint = x => axios.post(`${SERVER}/api/map/med-point-map`, JSON.stringify(x),{headers})
const cases = x => axios.post(`${SERVER}/api/map/cases-map`, JSON.stringify(x),{headers})

export default {
  world,
  medPoint,
  cases,
}
